const DetailsPage = () => {
  return (
    <div className="relative">
      <div className="h-96">
        <img src="/assets/images/onepiece_bg.jpg"  className="h-full w-full object-cover" alt="" />
      </div>
      <div className="absolute text-white top-0">
        Lorem ipsum dolor sit, amet consectetur adipisicing elit. Autem minima alias et inventore culpa vel eveniet, dicta nemo laudantium beatae!
      </div>
    </div>
  );
};

export default DetailsPage;
